import HighchartsReact from 'highcharts-react-official'
import Highcharts from 'highcharts'
import VennModule from "highcharts/modules/venn.js"
import {useEffect, useState} from 'react'
import {fetchOverlapBetweenGroups} from '../logic'
VennModule(Highcharts)


let vennOptions = {
    title: {
        text: 'Total Overlap Between Groups'
    },
    chart: {
        backgroundColor: "#5a1541CC",
        borderWidth: 2,
        borderColor: "#fff",
        borderRadius: 20,
        className : "",
        animation: false,
    },
    series: [{
        type: 'venn',
        name: 'Decline Reasons',
        data: [{
            sets: ['Seeds'],
            value: 10000
        }, {
            sets: ['Fruit Stars'],
            value: 10000
        }, {
            sets: ['Peapolis'],
            value: 10000
        },
        //     {
        //     sets: ['Seeds', 'Fruit Stars'],
        //     value: 12,
        //     name: 'Slow Hi'
        // }, {
        //     sets: ['Seeds', 'Peapolis'],
        //     value: 13,
        //     name: 'Slow'
        // }, {
        //     sets: ['Fruit Stars', 'Peapolis'],
        //     value: 10,
        //     name: 'Not the best'
        // }, {
        //     sets: ['Seeds', 'Fruit Stars', 'Peapolis'],
        //     value: 15,
        //     name: 'She is daydreaming'
        // }
        ]
    }]
}

const Diagram = () => {
    const fetchData = async () => {
        const data =  await fetchOverlapBetweenGroups()
        return data
    }
    useEffect(() => {
        let allCategories = []
       fetchData().then((res) => {
           if (res) {
               res.forEach((elem) => {
                   const groups = elem.name.split("->")
                   allCategories = [...allCategories, ...groups]
               })
           }

       })

    }, [])





    return (
        <HighchartsReact
            highcharts={Highcharts}
            options={vennOptions}
        />
    )
}

export default Diagram
